(ns spacial-dusk
  (:use [gorilla-repl.image])
  (:import 
    [org.opencv.core Core Point Rect Mat CvType Size Scalar]
    org.opencv.imgcodecs.Imgcodecs
    org.opencv.imgproc.Imgproc)
  (:require 
    [opencvfun.utils :as u]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def neko 
  (u/load-mat-from-url "https://a.wattpad.com/useravatar/ReaderOfTheReads.256.435663.jpg"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;spacial-dusk/neko</span>","value":"#'spacial-dusk/neko"}
;; <=

;; @@
(u/mat-view neko)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"256\" height=\"256\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x40bdea43 \"BufferedImage@40bdea43: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1bf6bb06 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 256 height = 256 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def gray (Mat.))
(Imgproc/cvtColor neko gray Imgproc/COLOR_RGB2GRAY)
(u/mat-view gray)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"256\" height=\"256\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x756819a5 \"BufferedImage@756819a5: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@622dfe54 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 256 height = 256 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def small-gray-neko (u/quick-zoom gray 0.5 Imgproc/INTER_LINEAR))
(u/mat-view small-gray-neko)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"128\" height=\"128\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x12cd2f71 \"BufferedImage@12cd2f71: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@622dfe54 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 128 height = 128 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def equalized (Mat.))
(Imgproc/equalizeHist small-gray-neko equalized)
(u/mat-view equalized)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"128\" height=\"128\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x39453d8d \"BufferedImage@39453d8d: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@622dfe54 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 128 height = 128 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def dilated (u/mat-from small-gray-neko))
(def dilation-size 2)
(def element (Imgproc/getStructuringElement  Imgproc/MORPH_RECT
  (Size. (inc (* 2 dilation-size)) (inc (* 2 dilation-size)))))
(Imgproc/dilate small-gray-neko dilated element)
(u/mat-view dilated)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"128\" height=\"128\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x331c7b3c \"BufferedImage@331c7b3c: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@622dfe54 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 128 height = 128 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def sobel (u/mat-from small-gray-neko))
(Imgproc/Sobel small-gray-neko sobel -1 0 1)
(u/mat-view sobel)
